import React from "react";
import { useNavigate } from "react-router-dom";

function Base(){

    const navigate = useNavigate();

    const mainPage = ()=>{
        navigate('/')
    }
    const example =() =>{
        navigate('/123')
    }

    const back =()=>{
        navigate(-1)
    }

    return (
        <div>
            <button onClick={mainPage}>MainPage</button>
            <button onClick={example}>example1</button>
            <button onClick={example}>example2</button>
            <button onClick={back}>Back</button>



        </div>
    )
};

export default Base;
